import React from 'react';
import './Navbar.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Contact from '../NavBarFunctions/Contact'; // Import the Contact component

export default function Navbar() {
  return (
    <Router>
      <nav className="navbar">
        <div className="brand-logo-container">
          <h3 className="brand-logo">gciConnect</h3>
          <img 
            src="/GCISL_logo_fullcolor.png" 
            alt="Granger Cobb Institute Logo"
            className="logo"
          />
        </div>
        <div className="navbar-right">
          <ul className="nav-links">
            <li><a href="/">Home</a></li>
            <li><a href="/get-involved">Get Involved</a></li>
            <li><a href="/contact">Contact Us</a></li> {/* Corrected path */}
            <li><a href="/about" className="active">About</a></li>
            <li><a href="/login" className="login-button">Log in</a></li>
          </ul>
        </div>
      </nav>

      {/* Define routes */}
      <Routes>
        <Route path="/contact" element={<Contact />} /> {/* Define route for /contact */}
        {/* Add other routes as necessary */}
      </Routes>
    </Router>
  );
}
